import { Component } from '@angular/core';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
})
export class HomeComponent {
}
<title>Unity in Angular with ASP.NET Core</title>
<style>
  body {
    display: flex;
    align-items: center;
    justify-content: center;
    height: 100vh;
    margin: 0;
    background-color: #f0f0f0;
  }

  .unity-container {
    border: 2px solid #333;
    border-radius: 8px;
    overflow: hidden;
  }
</style>
<body>

  <div class="unity-container">
    <unity></unity>
  </div>

</body>
